import React from 'react';

function MovieTable() {
    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Title</th>                        
                        <th>Year</th>
                        <th>Runtime</th>
                        <th>Genres</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>movie list</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default MovieTable;
